  getProducts(page: number, pagesize: number): Observable<Product[]> {
    const start = (page - 1) * pagesize;
    const end = start + pagesize;

    var products = this.dummyData.slice(start,end);
    return of(products);
  }

  getProductById(id: number): Observable<Product> | undefined {
    const product = this.dummyData.find(p => p.id === id);
    if (product === undefined) {
      console.warn("DummyProductService.getProductById: no product found with id: " + id);
      return undefined;
    }
    return of(product);
  }
